import React from "react";
import { Icon } from "../../Shared/svg/Icon";
import { useDispatch, useSelector } from "react-redux";
import {
  nextPage,
  previousPage,
  selectPage,
} from "../../Features/store/pageSlice";
import { MenuConteiner, ButtonConteiner } from "./style";

export default function HeaderMenu() {
  const dispatch = useDispatch();
  const active = useSelector(selectPage);
  return (
    <div>
      <MenuConteiner>
        <ButtonConteiner onClick={() => nextPage()}>
          <Icon id="arrow" className="arrow-icon left" /> о сотруднике
        </ButtonConteiner>
        <ButtonConteiner onClick={() => dispatch(previousPage())}>
          о компании
          <Icon id="arrow" className="arrow-icon right" />
        </ButtonConteiner>
      </MenuConteiner>
    </div>
  );
}
